"use strict";webui.define("webui-content",{attr:["src"],connected:t=>{t.fetchContent(t)},fetchContent:async function(t){if(t.src)try{let content=await fetch(t.src);if(!content.ok)return void(t.innerHTML=`Failed to load content from ${t.src}`);let body=await content.text();if(body.startsWith("<!DOCTYPE"))return void(t.innerHTML=`Source ${t.src} did not return expected markdown/html snippet (Full HTML documents are not allowed by t component)`);if(t.hasAttribute("slot"))t.innerHTML=webui.applyAppDataToContent(body);else{let temp=document.createElement("div");temp.innerHTML=webui.applyAppDataToContent(body);let n=[],p=t.parentNode,b=t;temp.childNodes.forEach((node=>{n.push(node)})),n.forEach((node=>{p.insertBefore(node,b)})),t.parentNode!==p&&b.remove(),t.remove()}}catch(ex){t.innerHTML=`Source ${t.src} failed to load:${ex}`}else setTimeout((()=>t.fetchContent()),10)}});